import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { companyService } from '../services/api';
import { useNavigate } from 'react-router-dom';

const CompanySetup = () => {
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    industry: '',
    size: '',
    vision: '',
    mission: '',
    values: '',
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const { user } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const valuesArray = formData.values
        .split(',')
        .map(v => v.trim())
        .filter(v => v);

      const companyData = {
        ...formData,
        values: valuesArray,
      };

      await companyService.updateCompany(companyData);
      navigate('/dashboard');
    } catch (error) {
      setError(error.response?.data?.error || 'حدث خطأ أثناء إعداد الشركة');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ 
      minHeight: '100vh', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center',
      padding: '20px',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'
    }}>
      <div className="card" style={{ width: '100%', maxWidth: '600px' }}>
        <div className="text-center mb-20">
          <h1 style={{ 
            fontSize: '2rem', 
            fontWeight: '700', 
            color: '#667eea',
            marginBottom: '10px'
          }}>
            إعداد الشركة
          </h1>
          <p style={{ color: '#6c757d' }}>
            مرحباً {user?.name}، يرجى إكمال بيانات شركتك للبدء
          </p>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label className="form-label">اسم الشركة *</label>
            <input
              type="text"
              name="name"
              className="form-input"
              value={formData.name}
              onChange={handleChange}
              required
              placeholder="أدخل اسم الشركة"
            />
          </div>

          <div className="form-group">
            <label className="form-label">وصف الشركة</label>
            <textarea
              name="description"
              className="form-input"
              value={formData.description}
              onChange={handleChange}
              rows="3"
              placeholder="وصف مختصر عن الشركة ونشاطها"
            />
          </div>

          <div className="grid grid-2">
            <div className="form-group">
              <label className="form-label">القطاع</label>
              <input
                type="text"
                name="industry"
                className="form-input"
                value={formData.industry}
                onChange={handleChange}
                placeholder="مثل: التكنولوجيا، التجارة، الخدمات"
              />
            </div>

            <div className="form-group">
              <label className="form-label">حجم الشركة</label>
              <select
                name="size"
                className="form-input"
                value={formData.size}
                onChange={handleChange}
              >
                <option value="">اختر حجم الشركة</option>
                <option value="startup">ناشئة (1-10 موظف)</option>
                <option value="small">صغيرة (11-50 موظف)</option>
                <option value="medium">متوسطة (51-200 موظف)</option>
                <option value="large">كبيرة (200+ موظف)</option>
              </select>
            </div>
          </div>

          <div className="form-group">
            <label className="form-label">الرؤية</label>
            <textarea
              name="vision"
              className="form-input"
              value={formData.vision}
              onChange={handleChange}
              rows="2"
              placeholder="رؤية الشركة المستقبلية"
            />
          </div>

          <div className="form-group">
            <label className="form-label">الرسالة</label>
            <textarea
              name="mission"
              className="form-input"
              value={formData.mission}
              onChange={handleChange}
              rows="2"
              placeholder="رسالة الشركة وأهدافها"
            />
          </div>

          <div className="form-group">
            <label className="form-label">القيم الأساسية</label>
            <input
              type="text"
              name="values"
              className="form-input"
              value={formData.values}
              onChange={handleChange}
              placeholder="الجودة، الشفافية، الابتكار (مفصولة بفواصل)"
            />
          </div>

          {error && <div className="error">{error}</div>}

          <button
            type="submit"
            className="btn btn-primary"
            style={{ width: '100%' }}
            disabled={loading}
          >
            {loading ? 'جاري الإعداد...' : 'إكمال الإعداد'}
          </button>
        </form>
      </div>
    </div>
  );
};

export default CompanySetup;
